# Insert the default color schemes into the database
foreach($schemes as $scheme => $details) {
  if(intval($wpdb->get_var($wpdb->prepare("SELECT COUNT(*) FROM $wpdb->posts WHERE post_name = 'eacs-default-$scheme';"))) < 1) {
    $id = wp_insert_post(array(
      'post_type' => $slug,
      'post_status' => 'publish',
      'ping_status' => 'closed',
      'comment_status' => 'closed',
      'post_name' => "eacs-default-$scheme",
      'post_title' => ucwords($scheme),
      'post_excerpt' => "A $scheme-ish color scheme",
      'post_content' => $details['css']
    ));

    if($id > 0) update_post_meta($id, '_eacs_colors', $details['colors']);
  }
}
